import React from 'react';

const ImageLinkForm = () => {
    return (
        <div>
            <p className='f3'>
                {"Scanner l'image pour détecter s'il y a un visage."}
            </p>
            <div>
                <input type='tex' />
                <button>Scanner</button>
            </div>
        </div>
    )
}

export default ImageLinkForm;
